    require(balances[msg.sender] >= totalAmount, "Not enough tokens");

    balances[msg.sender].sub(totalAmount);

    for(uint i = 0; i < _receivers.length; i++) {
      balances[_receivers[i]] = balances[_receivers[i]].add(_value);
